import React from 'react';
import '../styles.css';

const noPage = ({navBar}) => { 
    return(<PageSetup generalTitle="Raide Energy" pageTitle="Home">
        <div style={{textAlign: "left", fontSize: "20px", position: "relative", top: "100px", padding: "100px"}}>
            {"Nuestra compañía se especializa en la fabricación de generadores eólicos y de paneles fotovoltaicos."}
        </div>
    </PageSetup>) 
}

export default noPage;
